/*******************************************************************************
 * Parameters passed to function will be:
 * - workbook: Object representing the workbook
 *   - workbook.root:  Root directory path
 *   - workbook.dir:  Directory path without final separator
 *   - workbook.dirWithSep:  Directory path with final separator
 *   - workbook.base:  File name with extension
 *   - workbook.name:  File name without extension
 *   - workbook.ext:  Extension of file
 *   - workbook.sep:  File separator
 *   - workbook.sheets:  Array of all sheet names
 * - sheet:  Object representing the worksheet
 *   - sheet.name:  Name of the worksheet
 *   - sheet.index:  Index of the tab (0-based)
 * 
 * Don't return anything or return a `false`-ish value if you want to skip a
 * specific sheet or workbook.
 ******************************************************************************/

this['<WORKBOOK> - <SHEET>.csv'] = function(workbook, sheet) {
  return workbook.dirWithSep + workbook.name + ' - ' + sheet.name + '.csv';
};

this['<WORKBOOK> - <SHEET>.tsv'] = function(workbook, sheet) {
  return workbook.dirWithSep + workbook.name + ' - ' + sheet.name + '.tsv';
};

this['<WORKBOOK> - <SHEET>.json'] = function(workbook, sheet) {
  return workbook.dirWithSep + workbook.name + ' - ' + sheet.name + '.json';
};
